import { useState } from 'react';
import AddCargo from './components/AddCargo';
import React from 'react';



const App = () => {
  const [cargos, setCargos] = useState([
    {
      id: 'CARGO001',
      name: 'Строительные материалы',
      status: 'В пути',
      origin: 'Москва',
      destination: 'Казань',
      departureDate: '2024-11-24',
    },
    {
      id: 'CARGO002',
      name: 'Хрупкий груз',
      status: 'Ожидает отправки',
      origin: 'Санкт-Петербург',
      destination: 'Екатеринбург',
      departureDate: '2024-11-26',
    },
  ]);

    const addCargo = (newCargo) => {
      const id = `CARGO${(cargos.length + 1).toString().padStart(3, "0")}`;
      const updatedCargo = { ...newCargo, id };
      setCargos((prev) => [...prev, updatedCargo]);
    };
  return (
    <div className="App">
      <AddCargo addCargo={addCargo} />
    </div>
  );
}

export default App;
